import { AxiosRequestConfig } from 'axios';
import { requestBackend } from 'util/requests';
import { SecurityPolicy } from 'types/securitypolicy';
import { useForm } from 'react-hook-form';

import './styles.css';

type FormData = {
  code: string;
  description: string;
  enableAd: boolean;
  passwordQtyDaysExpiration: number;
  passwordContainsNumber: boolean;
  passwordContainsLetterUpperCase: boolean;
  passwordContainsLetterLowerCase: boolean;
  passwordContainsSpecialKey: boolean;
  passwordQtyMinKeys: number;
  passwordQtyOldNotUse: number;
  sessionTimeOut: number;
};

type Props = {
  onInsertSecurityPolicy: (securityPolicy: SecurityPolicy) => void;
};

const SecurityPolicyForm = ({ onInsertSecurityPolicy }: Props) => {
  const { register, handleSubmit, reset } = useForm<FormData>();

  const onSubmit = (formdata: FormData) => {
    const params: AxiosRequestConfig = {
      method: 'POST',
      url: '/security-policy',
      data: formdata,
      withCredentials: true,
    };

    requestBackend(params)
      .then((response) => {
        reset();

        onInsertSecurityPolicy(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <>
      <div className="security-policy-crud-container">
        <form onSubmit={handleSubmit(onSubmit)}>
          <label htmlFor="code">Código</label>
          <input {...register('code')} type="text" id="code" />

          <label htmlFor="description">Descrição</label>
          <input {...register('description')} type="text" id="description" />

          <label htmlFor="enableAd">Integração com AD</label>
          <select {...register('enableAd')} id="enableAd">
            <option value="true">Sim</option>
            <option value="false">Não</option>
          </select>

          <label htmlFor="passwordQtyDaysExpiration">Expiração da senha</label>
          <input
            {...register('passwordQtyDaysExpiration')}
            type="number"
            id="passwordQtyDaysExpiration"
          />

          <label htmlFor="passwordContainsNumber">Contém números?</label>
          <select
            {...register('passwordContainsNumber')}
            id="passwordContainsNumber"
          >
            <option value="true">Sim</option>
            <option value="false">Não</option>
          </select>

          <label htmlFor="passwordContainsLetterUpperCase">
            Letras maiúsculas
          </label>
          <select
            {...register('passwordContainsLetterUpperCase')}
            id="passwordContainsLetterUpperCase"
          >
            <option value="true">Sim</option>
            <option value="false">Não</option>
          </select>

          <label htmlFor="passwordContainsLetterLowerCase">
            Letras minúsculas
          </label>
          <select
            {...register('passwordContainsLetterLowerCase')}
            id="passwordContainsLetterLowerCase"
          >
            <option value="true">Sim</option>
            <option value="false">Não</option>
          </select>

          <label htmlFor="passwordContainsSpecialKey">
            Caracteres especiais
          </label>
          <select
            {...register('passwordContainsSpecialKey')}
            id="passwordContainsSpecialKey"
          >
            <option value="true">Sim</option>
            <option value="false">Não</option>
          </select>

          <label htmlFor="passwordQtyMinKeys">Caracteres mínimos</label>
          <input
            {...register('passwordQtyMinKeys')}
            type="number"
            id="passwordQtyMinKeys"
          />

          <label htmlFor="passwordQtyOldNotUse">Senhas antigas</label>
          <input
            {...register('passwordQtyOldNotUse')}
            type="number"
            id="passwordQtyOldNotUse"
          />

          <label htmlFor="sessionTimeOut">Tempo de sessão</label>
          <input
            {...register('sessionTimeOut')}
            type="number"
            id="sessionTimeOut"
          />

          <button type="submit">Salvar</button>
        </form>
      </div>
    </>
  );
};

export default SecurityPolicyForm;
